$('.card-photo-swiper')

$('.tab-info').on('click', function () {
   $(this).toggleClass('active');
});

$('.tabs-switch__item').on('click', function () {
    $('.tabs-switch__item.active').removeClass('active');
    $(this).addClass('active');
});

$('.cat-item__photos-slider').slick({
    arrows: true,
    slidesToShow: 3,
    slidesToScroll: 2,
    centerMode: true,
});

$('.cat-item__price-slider').slick({
    arrows: true,
    slidesToShow: 2,
    slidesToScroll: 2,
    centerMode: true,
});

$('.filter__select--header').on('click', function () {
    $(this).parent().toggleClass('active');
});

$('.filter__select--option').on('click', function () {
    $(this).toggleClass('active');
});

$('.filter__close').on('click', function () {
    $('.filter').removeClass('active');
});


$('.register-tab__item').on('click', function () {
    $('.register-tab__item.active').removeClass('active');
    $(this).addClass('active');
})

$('.dropdown').on('click', function () {
    $(this).toggleClass('active');
});


$(document).mouseup(function (e){
    let dropdown = $(".dropdown");
    if (!dropdown.is(e.target) && dropdown.has(e.target).length === 0) {
        $('.dropdown.active').removeClass('active');
    }
});



$('.select2').select2();

// carousel
$('.carousel-wrapper').removeClass('hidden');
$('.carousel-wrapper').slick({
    infinite: true,
    arrows: false,
    dots: true,
    slidesToShow: 2,
    dotsClass: 'carousel-wrapper-custom-dots',
    responsive: [
        {
            breakpoint: 480,
            settings: {
                slidesToShow: 1,
                dots: false
            }
        }
    ]
});

// main-poster carousel
var swiperPosterCat = new Swiper('.main-poster-swiper', {
    slidesPerView: 'auto',
    spaceBetween: 20,
    loop: true,
    centeredSlides: true,

    navigation: {
        nextEl: '.main-poster-next',
        prevEl: '.main-poster-prev',
    },
    breakpoints: {
        768: {
            slidesPerView: 3,
            spaceBetween: 15,
            centeredSlides: false,
        },
        1300: {
            centeredSlides: true,
        }
    }
});


$('.photo-reports__tabs-item').on('click', function () {
    $(this).toggleClass('active');
});

$('.aside-slider__wrap').slick({
    infinite: true,
    slidesToShow: 1,
});

var swiperPosterBlock = new Swiper('.poster-block-slider', {
    slidesPerView: 'auto',
    spaceBetween: 20,
    loop: false,
    centeredSlides: false,

    navigation: {
        nextEl: '.poster-cat-next',
        prevEl: '.poster-cat-prev',
    },
    breakpoints: {
        1300: {
            centeredSlides: true,
        },
        768: {
            slidesPerView: 2,
            spaceBetween: 10,
            centeredSlides: false,
        },
    }
});

/*poster cat page tabs*/
$('.poster-cat-tabs__list-item').on('click', function () {
    let idTab = $(this).attr('data-tab');
    $('.poster-cat-tabs__list-item.active').removeClass('active');
    $(this).addClass('active');

    $('.poster-cat-tabs__item.active').removeClass('active');
    $(idTab).addClass('active');
});


