$('.top-filter-min__item-more').on('click', function () {
    let menu = $(this).parent();

    if ($(this).hasClass('active')) {
        menu.find('.top-filter-min__item.show').addClass('hide').removeClass('show')
    } else {
        menu.find('.top-filter-min__item.hide').addClass('show').removeClass('hide')
    }
    $(this).toggleClass('active');
});

$('.main-map__footer--btn').on('click', function () {
    if ($('.main-map').hasClass('active')) {
        $('.main-map').removeClass('active');
    } else {
        $('.main-map').addClass('active');
    }
});

$('a[data-map-menu]').on('click', function () {
    let menu = $(this).attr('data-map-menu');
    $('.second-map-menu.active').removeClass('active');
    $(menu).addClass('active')
})

$('.main-nav__item').hover(function () {
    let menuId = $(this).attr('data-menu');

    if (typeof menuId !== typeof undefined && menuId !== false) {
        $(".main-nav__menu.show").removeClass('show');
        $("#" + menuId).addClass('show');
    } else {
        $(".main-nav__menu").removeClass('show');
    }
});

$('.main-nav__menu').mouseout(function () {
    $(".main-nav__menu.show").removeClass('show');
});
